import React, { FC, useEffect } from "react";
import Layout from "../components/common/Layout";
import Feed from "../components/feed/FeedContainer";
import isAuthenticated from "../lib/isAuthenticated";

const Index: FC = () => {
  useEffect(() => {
    isAuthenticated();
  }, []);

  return (
    <Layout>
      <Feed />
    </Layout>
  );
};

export default Index;
